import React, { Component } from 'react';
import { BrowserRouter } from 'react-router-dom';
import { Route } from 'react-router-dom';

import './App.css';
import Home from './Home';

class App extends Component {
  render() {
    return (
      <div>
        <Route path="/" exact component={Home} />
      </div>
    );
  }
}

export default App;
